import React from "react";

const Categories = () => {
  return (
    <ul className="tags">
      {categories.map((item, i) => (
        <li
          onClick={() => setCategoriesActive(i)}
          className={categoriesActive === i ? "active" : ""}
          key={i}
        >
          {item.name}
        </li>
      ))}
    </ul>
  );
};

export default Categories;
